import React, { useEffect } from 'react';
import { useLogged } from '../App';


export function Home(props) {

    var { isLoading, error, data } = useLogged()
    var mustRender = false

    useEffect(() => {
        if (data.logged === true) {
            this.mustRender = true
        }
    })

    return (
        <div>
            {
                mustRender === true &&
                <div>
                    <p> user: {props.user}</p>
                    <p> password: {props.password}</p>
                </div>
            }
        </div>
    )
}
